  false,\n\t\"url\": null,\n\t\"notes\": \"Physical, meteorological, and other data
  were collected from XBT casts, buoys, and other instruments from a World-Wide distribution.
  Data were collected from 17 November 2002 to 20 December 2002. Data were submitted
  by the Marine Environmental Data Service (MEDS) in support of the Array for Real-time
  Geostrophic Oceanography (Argo), the World Ocean Circulation Experiment (WOCE),
  the Gulf of Mexico NOAA/NMFS Ship of Opportunity (SOOP), and the Global Temperature-Salinity
  Pilot Project (GTSPP). Physical parameters include profiles of temperature and salinity.
  Meteorological data include dry bulb temperature, wind speed, wind direction, relative
  humidity, and air pressure.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
